import React, { useState, useEffect } from "react";
import Entry from "./Entry";
import EntryHeading from "./EntryHeading";
import PayrollPalClient from '../payroll-pal-client'

function EntriesList() {
    const [payPeriodStart, updatePayPeriodStart] = useState('10/21/19')
    const [payPeriodEnd, updatePayPeriodEnd] = useState('10/25/19')

    let entries = PayrollPalClient.getEntries(payPeriodStart, payPeriodEnd);
    const [totalHours, updateTotalHours] =  useState(entries['totalHours'])

    useEffect( () => {
        entries = PayrollPalClient.getEntries(payPeriodStart, payPeriodEnd)
        updateTotalHours(entries['totalHours'])
    });

    return(
        <div>
            <EntryHeading 
                    payPeriodStart={payPeriodStart} 
                    payPeriodEnd={payPeriodEnd} 
                    updatePayPeriodStart={updatePayPeriodStart} 
                    updatePayPeriodEnd={updatePayPeriodEnd}
            />
            {
                entries['entries'].map(entry => {
                    return <Entry {...entry} />
                })
            }
        </div>
    )

}

export default EntriesList;
